import numpy as np
import pandas as pd
import matplotlib.pyplot as plt
from sklearn.preprocessing import MinMaxScaler
from sklearn.metrics import mean_squared_error
from tensorflow.keras.models import Sequential
from tensorflow.keras.layers import Dense, LSTM, Dropout
from tensorflow.keras.optimizers import Adam, RMSprop, SGD

"""![image.png](data:image/png;base64,)

# Load the Dataset
"""

df = pd.read_csv('AirPassengers.csv')
df.columns = ['Month', 'Passengers']
df['Month'] = pd.to_datetime(df['Month'])
# df.set_index('Month', inplace=True)
df.head()

df.shape

df['Month'].unique()

"""![image.png](data:image/png;base64,)

# Handle Missing Values & Scale Data
"""

df.isnull().sum()  # Check missing values

"""#MinMax Scaling

![image.png](data:image/png;base64,)

![image.png](data:image/png;base64,)
"""

scaler = MinMaxScaler()
scaled_data = scaler.fit_transform(df[['Passengers']])

scaled_data[:3]

len(scaled_data)

X, y = [], []
for i in range(12, len(scaled_data)):
    X.append(scaled_data[i-12:i])
    y.append(scaled_data[i])

X, y = np.array(X), np.array(y)

"""![image.png](data:image/png;base64,)

![image.png](data:image/png;base64,)

#train test splitting
"""

from sklearn.model_selection import train_test_split
X_train,X_test,y_train,y_test = train_test_split(X,y, test_size=0.25, random_state=42)

"""#Reshaping the data"""

X_train = np.reshape(X_train,(X_train.shape[0],X_train.shape[1],1))
X_test = np.reshape(X_test,(X_test.shape[0],X_test.shape[1],1))

print(X_train.shape)
print(X_test.shape)

"""#Define Complex RNN Model (Multiple Layers + Dropout)


"""

def build_model(activation='relu',optimizer='Adam', units=50):
  model = Sequential()
  model.add(LSTM(units=units,activation=activation, return_sequences=True, input_shape=(X_train.shape[1],1)))
  model.add(Dropout(0.5))
  model.add(LSTM(units=units//2,activation=activation, return_sequences=True))
  model.add(Dropout(0.5))
  model.add(LSTM(units=units//3,activation=activation, return_sequences=False))
  model.add(Dropout(0.5))
  model.add(Dense(1))
  model.compile(loss='mse',optimizer=optimizer)
  return model

"""#Train the Model with Hyperparameter Tuning

"""

model = build_model('relu',optimizer=RMSprop(learning_rate=0.01),units=64)
history = model.fit(X_train,y_train,batch_size=32,epochs=50,validation_data=(X_test,y_test))

"""#making Predictions out of the Model"""

Predictions = model.predict(X_test)
Predictions.shape

"""#Plotting Actual VS Predictions

But before that inverse transforming our data as it was standardized using MinMax Scaler.
"""

actual = scaler.inverse_transform(y_test.reshape(-1,1))

#Reshaping Predictions as they were 3D Dimensional
predicted = scaler.inverse_transform(Predictions)

plt.figure(figsize=(12, 5))

time_steps = np.arange(len(actual))
plt.plot(time_steps, actual, label='Actual')
plt.plot(time_steps, predicted, label='Predicted')
plt.title('Airline Passenger Prediction - RNN')
plt.xlabel('Time Steps')
plt.ylabel('Passengers')
plt.legend()
plt.grid(True)
plt.show()

"""![image.png](data:image/png;base64,)

#Trying Different Activations
#1.ReLu
"""

model_relu = build_model('relu',SGD(learning_rate=0.01, momentum=0.9),units=64)
history_relu = model_relu.fit(X,y, batch_size=32, verbose=1, epochs=50)

"""#2.Sigmoid"""

model_sigmoid = build_model('sigmoid','Adam',units=64)
history_sigmoid = model_sigmoid.fit(X,y, batch_size=32, verbose=1, epochs=50)

"""#Comparison"""

plt.figure(figsize=(6,3))

plt.plot(history_relu.history['loss'], label='ReLU')
plt.plot(history_sigmoid.history['loss'], label='Sigmoid')

plt.xlabel('Epochs')
plt.ylabel('Loss')
plt.legend()
plt.title("Relu VS Sigmoid")

"""![image.png](data:image/png;base64,)

# Try different optimizers

#SGD Stochastic Gradient Descent
"""

model_sgd = build_model('relu',SGD(learning_rate=0.01),units=64)
history_sgd = model_sgd.fit(X,y, batch_size=32, verbose=1, epochs=50)

"""#Adam"""

model_adam = build_model('relu',Adam(learning_rate=0.01),units=64)
history_adam = model_adam.fit(X,y, batch_size=32, verbose=1, epochs=50)

"""#RMSprop Root Mean Square Propagation"""

model_RMSprop = build_model('relu',RMSprop(learning_rate=0.01),units=64)
history_RMSprop = model_RMSprop.fit(X,y, batch_size=32, verbose=1, epochs=50)

"""#Comparison"""

plt.figure(figsize=(6,3))

plt.plot(history_sgd.history['loss'], label='SGD')
plt.plot(history_adam.history['loss'], label='Adam')
plt.plot(history_RMSprop.history['loss'], label='RMSprop')

plt.xlabel('Epochs')
plt.ylabel('Loss')
plt.legend()
plt.title('SGD VS PMS_prop VS Adam')

